import React from 'react'

import {

  Routes,
  Route,
} from "react-router-dom";
import ProjectForm from './ProjectForm';
import Home from 'components/Home'
function App() {
  return (
  <div> 
    <h1>hei</h1>
    <Routes>
      <Route path="/" element={<ProjectForm />} />
      <Route path="/d" element={<Home />}/>
    </Routes>
</div>
  )
}

export default App
